import React from "react";
const Home = () => {
  return (
    <>
      <br></br>
      <h1>Welcome to QuizMaster</h1>
      <br></br>
      <h6>
        1. Each quiz consists of multiple-choice questions that you need to
        answer within a specified time frame.
      </h6>
      <h6>2. Instant Result Generated.</h6>
  
    
      <h6>
        3. A user-friendly interface that allows teachers to easily create and
        customize quizzes to fit their specific teaching needs.
      </h6>
      <h6>
        4 .Use QuizMaster as a fun and educational tool to engage your students
        in learning and encourage them to study more.
      </h6>
    </>
  );
};

export default Home;
